original_question:
$z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$이고, $c = 2 - 3i$라고 하자. $w$는 $z$가 $c$를 중심으로 반시계 방향으로 $\frac{\pi}{4}$만큼 회전했을 때의 결과라고 하자.

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
C = (2,-3);
W = rotate(45,C)*(Z);

draw(Z--C--W);

dot("$c$", C, N);
dot("$w$", W, SE);
dot("$z$", Z, S);
label("$\frac{\pi}{4}$", C + (0.6,-1));
[/asy]

$w$를 구하시오.

